scene.onHitWall(SpriteKind.inteaction, function (sprite, location) {
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile86`)) {
        Render.moveWithController(0, 0, 0)
        inDoorConsle = true
        doorConsleMenu = miniMenu.createMenu(
        miniMenu.createMenuItem("1"),
        miniMenu.createMenuItem("2"),
        miniMenu.createMenuItem("3"),
        miniMenu.createMenuItem("4"),
        miniMenu.createMenuItem("5"),
        miniMenu.createMenuItem("6"),
        miniMenu.createMenuItem("7"),
        miniMenu.createMenuItem("8"),
        miniMenu.createMenuItem("9"),
        miniMenu.createMenuItem("0")
        )
        doorConsleMenu.setTitle("Enter Passcode")
        doorConsleMenu.setDimensions(135, 20)
        doorConsleMenu.setMenuStyleProperty(miniMenu.MenuStyleProperty.Rows, 1)
        doorConsleMenu.setStyleProperty(miniMenu.StyleKind.DefaultAndSelected, miniMenu.StyleProperty.Padding, miniMenu.createBorderBox(
        4,
        0,
        4,
        0
        ))
        doorConsleMenu.left = 10
        doorConsleMenu.setFlag(SpriteFlag.RelativeToCamera, true)
        doorConsleMenu.onButtonPressed(controller.A, function (selection, selectedIndex) {
            passcodeEntered = "" + passcodeEntered + selection
            doorConsleMenu.setTitle(passcodeEntered)
            if (passcodeEntered.length == 5) {
                sprites.destroy(doorConsleMenu)
                Render.moveWithController(2, 3, 1)
                inDoorConsle = false
                if (convertToText("" + passcodeArray[0] + passcodeArray[1] + passcodeArray[2] + passcodeArray[3] + passcodeArray[4]) == convertToText(passcodeEntered)) {
                    game.gameOver(true)
                } else {
                    passcodeEntered = ""
                }
            }
        })
        doorConsleMenu.onButtonPressed(controller.B, function (selection, selectedIndex) {
            sprites.destroy(doorConsleMenu)
            Render.moveWithController(2, 3, 1)
            inDoorConsle = false
        })
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile3`) && inCloset == false) {
        inCloset = true
        xValueCloset = mySprite.x
        yValueCloset = mySprite.y
        Render.moveWithController(0, 3, 0)
        tiles.setTileAt(location, assets.tile`transparency16`)
        tiles.setWallAt(location, false)
        tiles.placeOnTile(mySprite, location)
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile20`) && inCloset == false) {
        inCloset = true
        xValueCloset = mySprite.x
        yValueCloset = mySprite.y
        Render.moveWithController(0, 3, 0)
        tiles.setTileAt(location, assets.tile`transparency16`)
        tiles.setWallAt(location, false)
        tiles.placeOnTile(mySprite, location)
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile66`)) {
        tiles.setTileAt(location, assets.tile`myTile67`)
        secretRoomOpen = true
        for (let value of tiles.getTilesByType(assets.tile`myTile68`)) {
            tiles.setTileAt(value, assets.tile`myTile69`)
            tiles.setWallAt(value, false)
        }
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile71`)) {
        tiles.setTileAt(location, assets.tile`myTile72`)
        for (let value of tiles.getTilesByType(assets.tile`myTile68`)) {
            tiles.setTileAt(value, assets.tile`myTile69`)
            tiles.setWallAt(value, false)
        }
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile87`)) {
        tiles.setTileAt(location, assets.tile`myTile93`)
        currentDigit += 1
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile91`)) {
        tiles.setTileAt(location, assets.tile`myTile93`)
        currentDigit += 1
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile89`)) {
        tiles.setTileAt(location, assets.tile`myTile93`)
        currentDigit += 1
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile88`)) {
        tiles.setTileAt(location, assets.tile`myTile93`)
        currentDigit += 1
    }
    if (tiles.tileAtLocationEquals(location, assets.tile`myTile92`)) {
        tiles.setTileAt(location, assets.tile`myTile93`)
        currentDigit += 1
    }
})
